window.bookSummaryJSON = "<p>A Horus Heresy audiobook collection.</p> <p>The Horus Heresy was the darkest moment in the history of mankind, as brother turned upon brother and threatened to tear the galaxy apart. This bundle of audiobooks delivers an action-packed, yet intimate look at the heroes and villains of the era.</p> <p>Listen to it because: in this collection of audiobooks, Black Library stalwarts take on big names and story beats pertaining to some of the landmark events of the Horus Heresy - the greatest conflict the galaxy has ever known.</p> <p>Contents:</p> <ul> <li><i>Butcher's Nails</i> by Aaron Dembski-Bowden</li> <li><i>Kharn: The Eightfold</i> Path by Anthony Reynolds</li> <li><i>Honour to the Dead</i> by Gav Thorpe</li> <li><i>Stratagem </i>by Nick Kyme</li> <li><i>Censure </i>by Nick Kyme</li> <li><i>Red-Marked</i> by Nick Kyme</li> <li><i>Nightfane </i>by Nick Kyme</li> <li><i>Hubris of Monarchia</i> by Andy Smillie</li> <li><i>Heart of the Pharos </i>by L J Goulding</li> <li><i>Children of Sicarus</i> by Anthony Reynolds</li> <li><i>Illyrium </i>by Darius Hinks</li> <li><i>The Revelation of the Word</i> by David Annandale</li> <li><i>Raven's Flight</i> by Gav Thorpe</li> <li><i>Strike and Fade</i> by Guy Haley</li> <li><i>Veritas Ferrum</i> by David Annandale</li> <li><i>Grey Talon</i> by Chris Wraight</li> <li><i>The Either</i> by Graham McNeill</li> <li><i>Perpetual </i>by Dan Abnett</li> <li><i>Raptor </i>by Gav Thorpe</li> <li><i>The Shadowmasters</i> by Gav Thorpe</li> </ul> <p>Narrators:</p> <ul> <li>Sean Barrett</li> <li>Chris Fairbank</li> <li>David Timson</li> <li>Jonathan Keeble</li> <li>Richard Reed</li> <li>John Banks</li> <li>Penelope Rawlins</li> <li>Toby Longworth</li> <li>Tim Treloar</li> <li>Gareth Armstrong</li> </ul>"; 
